import React from 'react';
import Game from '../Game/Game';
import  { Grid, Segment } from 'semantic-ui-react';

const GamesContainer = (props) => {
    const { games } = props
    return (
        <Grid column='equal'>
            <Grid.Column>
            {games.slice(0,3).map(game => <Segment>game={game}</Segment> )}
            </Grid.Column>
        </Grid>

    )
}



export default GamesContainer;
